// FOOTER JS
// ---------------------------------------------------------------------------

import React from 'react';
import "./style.css";

function Footer() {
    return (
        <div>
            <footer class="text-center fixed-bottom">
                <div class=" navbar-dark bg-dark text-light">
                    <i class="fas fa-copyright"></i> Kenneth I Petiote
                </div>
            </footer>
        </div>
    )
}

export default Footer;
